description:
                   Play Guitar With The Best Of AC/DC-2010kaiser
                   ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


This pack includes 2 CDs and a tab music book which allow you to play along to 13 of AC / DC 's best hits with full &quot;sound-alike&quot; backing tracks. The book features authentic arrangements of songs with full tab and standard notation, as well as the melody line. In addition to backing tracks to all the songs, the CDs also feature full performance tracks so you can hear what it's supposed to sound like before you play it yourself. Songs: Back in Black * Dirty Deeds Done Dirt Cheap * For Those About to Rock (We Salute You) * Hells Bells * Highway to Hell * It's a Long Way to the Top * Let There Be Rock * Rock and Roll Ain't Noise Pollution * Rock 'n' Roll Train * Thunderstruck * TNT * Whole Lotta Rosie * You Shook Me All Night Long.

Title: Play Guitar With The Best Of Ac / Dc (Book &amp; 2 Cds).
Author: AC / DC.
Publisher: Hal Leonard Corporation.
ISBN-10: 1849381593.
ISBN-13: 978-1849381598.
Year: 2010.
Format: PDF.

